import React from 'react';

function Cliente(){
    return(
        <div className="PaginaCliente">
            <h1>BENVENUTO, NOME COGNOME!</h1>
            <div className="row">
            <Card className=""
                imgUrl=""
                title="Informazioni personali"
                description="Comunicaci i tuoi dati personali e le modalità per contattarti"
            />
            </div>
        </div>

    );
}
export default Cliente;
